import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Component } from 'react';
import Greet from './components/greet';
import Welcome from './components/welcome';

class App extends Component {

  render(){
    return (
      <div className="App">
        <Greet />
        <Welcome />
      </div>
    );
  }



}

export default App;
